import "./reset.css";
import "./App.css";

import Header from "src/Components/Header";
import Main from "src/Components/Main";
import Footer from "src/Components/Footer";
import HornedBeast from "src/Components/HornedBeast";

function App() {
  return (
    <div className="App">
      <Header />
      <Main />
      <Footer />
      <HornedBeast />
    </div>
  );
}

export default App;
